SELECT MAX("lineorder"."lo_supplycost") as agg_0 FROM "lineorder" LEFT OUTER JOIN "part" ON "lineorder"."lo_partkey" = "part"."p_partkey" LEFT OUTER JOIN "supplier" ON "lineorder"."lo_suppkey" = "supplier"."s_suppkey" LEFT OUTER JOIN "customer" ON "lineorder"."lo_custkey" = "customer"."c_custkey"  WHERE "supplier"."s_suppkey" >= 145 AND "supplier"."s_nation" NOT LIKE '%FRANCE%' AND "lineorder"."lo_orderkey" >= 6194017 AND "supplier"."s_city" = 'ALGERIA  5' AND ("part"."p_type" LIKE '%BRASS%' OR "part"."p_type" IN ('SMALL ANODIZED TIN', 'ECONOMY BRUSHED TIN', 'SMALL ANODIZED COPPER')) AND "part"."p_type" NOT LIKE '%B%RUSHED%'